// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { awProgressIndicatorRenderFunction } from 'js/AwProgressIndicatorService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/AwProgressIndicatorService', () => import('js/AwProgressIndicatorService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "data": {
        "progressIndicatorStatus": false,
        "progressRefCount": 0,
        "subscriptions": []
    },
    "actions": {
        "registerEvents": {
            "actionType": "JSFunction",
            "method": "registerEvents",
            "inputData": {
                "name": "{{props.name}}",
                "data": "{{data}}",
                "progressIndicatorRef": "{{parameters.elementRefList}}"
            },
            "outputData": {
                "progressIndicatorRef": "progressIndicatorRef",
                "subscriptions": "subscriptions"
            },
            "deps": "js/AwProgressIndicatorService"
        },
        "render": {
            "method": "awProgressIndicatorRenderFunction",
            "options": {
                "elementRefList": [
                    "progressIndicatorRef"
                ]
            },
            "deps": "js/AwProgressIndicatorService"
        },
        "progressStart": {
            "actionType": "JSFunction",
            "method": "startProgressIndicator",
            "deps": "js/AwProgressIndicatorService"
        },
        "progressEnd": {
            "actionType": "JSFunction",
            "method": "stopProgressIndicator",
            "deps": "js/AwProgressIndicatorService"
        },
        "destroyIndicatorSubscription": {
            "actionType": "JSFunction",
            "method": "destroyIndicatorSubscription",
            "inputData": {
                "data": "{{data.subscriptions}}"
            },
            "deps": "js/AwProgressIndicatorService"
        }
    },
    "conditions": {},
    "onEvent": [],
    "lifecycleHooks": {
        "render": "render",
        "onMount": "registerEvents",
        "onUnmount": "destroyIndicatorSubscription"
    },
    "props": {
        "name": {
            "type": "string"
        }
    },
    "i18n": {
        "LOADING_TEXT": [
            "BaseMessages"
        ]
    },
    "_viewModelId": "AwProgressIndicator",
    "_uniqueViewModelId": "AwProgressIndicator",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awProgressIndicatorRenderFunction, {"elementRefList":["progressIndicatorRef"]}, ctxImportObj );

export default Component;
